# ERROR: output has same barrel sizes after each other
import api
import sys
import bisect
import time

PROBLEM_ID = "barrel"

def solve(input):
	data = sorted([(bsize, eamt, idx) for idx, (bsize, eamt) in enumerate(input)])
	state = []
	state_idx = []
	bref = {}
	for bsize, power, idx in data:
		power = -power
		bidx = bisect.bisect_left(state, power)
		if bidx == len(state):
			bref[idx] = state_idx[bidx-1] if bidx > 0 else None
			state.append(power)
			state_idx.append(idx)
		elif state[bidx]>power:
			bref[idx] = state_idx[bidx-1] if bidx > 0 else None
			state[bidx] = power
			state_idx[bidx] = idx
	result = []
	idx = state_idx[-1]
	while idx is not None:
		result.append(idx)
		idx = bref[idx]
	return [idx+1 for idx in result[::-1]]

